import "core-js/modules/web.dom.iterable";
import { parse } from '@/utils/webpack-key-path';

var modalContext = require.context('@/views/modals', true, /\.vue$/);

var modalKeys = modalContext.keys();
var routes = {};
modalKeys.forEach(function (keyPath) {
  var file = modalContext(keyPath);
  var component = file.default || file;
  var parsed = parse(keyPath);

  if (/(#)/.test(parsed.entry)) {
    return;
  }

  routes[parsed.entry_dash] = component;
});
export default routes;
